import {DOMAIN} from '../url'

function Body() {
  const dispatch = useDispatch()

  useEffect(() => {
     dispatch(getProducts)
  },[])
  return(
    <div>
      <p>Product 1</p>
      <p>Product 2</p>
      <p>Product 3</p>

      <a id='g-10' href={`/${DOMAIN}/?page=1`}>1</a>
      <a href={`/${DOMAIN}/?page=2`}>2</a>
    </div>
  )
}
export default Body
